// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";

contract LAND is ERC721 {
	uint private lastToken = 1015195;

	mapping(uint => uint) private breakPoints;
	mapping(uint => uint) private prices;
	mapping(uint => uint) private basePrices;

	address private admin;

	function totalSupply() public view returns (uint) {
		return lastToken;
	}

	constructor() ERC721("LAND", "LAND") {
		admin = msg.sender;

		// Breakpoints
		breakPoints[0] = 207974;
		breakPoints[1] = 516027;
		breakPoints[2] = 1015195;

		// Base Land Price
		basePrices[0] = 0.1 ether;
		basePrices[1] = 0.2 ether;
		basePrices[2] = 0.3 ether;

		// ETC
		prices[2] = 1.99 ether;
		prices[3] = 2.99 ether;
		prices[4] = 3.99 ether;

		// LTC
		prices[5] = 4.99 ether;
		prices[6] = 5.99 ether;
		prices[7] = 6.99 ether;

		// BTC
		prices[8] = 7.99 ether;
		prices[9] = 8.99 ether;
		prices[10] = 9.99 ether;
	}

	mapping(uint => uint) private status;
	mapping(address => uint[]) private myLands;
	mapping(address => mapping(uint => uint)) private ownershipIndex;
	mapping(address => uint[]) private myLandStatuses;
	mapping(address => mapping(uint => uint)) private ownerLandStatusIndex;

	mapping(address => mapping(uint => uint)) public latestInstall;
	mapping(address => mapping(uint => uint)) public eqCount;

	function getMyLands(address addr) public view returns (uint[] memory) {
		return myLands[addr];
	}
	function getMyLandStatuses(address addr) public view returns (uint[] memory) {
		return myLandStatuses[addr];
	}

	function getLevel(uint id) internal view returns (uint) {
		if (id <= breakPoints[0]) return 2;
		else if (id <= breakPoints[1]) return 1;
		return 0;
	}

	function mintLand(uint tokenId) payable external {
		uint level = getLevel(tokenId);
		require(msg.value == basePrices[level], 'Invalid Amount');

		require(tokenId > 0, "Invalid Token Id");
		require(tokenId <= lastToken, "Invalid Token Id");

		_mint(msg.sender, tokenId);

		status[tokenId] = 1;
		myLandStatuses[msg.sender].push(1);
		ownerLandStatusIndex[msg.sender][tokenId] = myLandStatuses[msg.sender].length;

		myLands[msg.sender].push(tokenId);
		ownershipIndex[msg.sender][tokenId] = myLands[msg.sender].length;
	}

	function mintMultiple(uint[] memory tokenIds) payable external {
		uint count = tokenIds.length;
		require(count > 0, "No Selection");

		uint level = getLevel(tokenIds[0]);
		require(msg.value == basePrices[level] * count, "Invalid Amount");

		for (uint i = 0; i < tokenIds.length; i++) {
			require(tokenIds[i] > 0, "Invalid Token Id");
			require(tokenIds[i] <= lastToken, "Invalid Token Id");
			require(level == getLevel(tokenIds[i]));

			_mint(msg.sender, tokenIds[i]);

			status[tokenIds[i]] = 1;
			myLandStatuses[msg.sender].push(1);
			ownerLandStatusIndex[msg.sender][tokenIds[i]] = myLandStatuses[msg.sender].length;

			myLands[msg.sender].push(tokenIds[i]);
			ownershipIndex[msg.sender][tokenIds[i]] = myLands[msg.sender].length;
		}
	}

	function _beforeTokenTransfer(address from, address to, uint256 tokenId) internal virtual override {
		require(from != to);

		if (status[tokenId] > 0) {
			// Delete current owner record
			delete myLands[from][ownershipIndex[from][tokenId] - 1];
			delete ownershipIndex[from][tokenId];

			delete myLandStatuses[from][ownerLandStatusIndex[from][tokenId] - 1];
			delete ownerLandStatusIndex[from][tokenId];

			if (status[tokenId] > 1) eqCount[from][status[tokenId]]--;


			// Set new owner record
			myLands[to].push(tokenId);
			ownershipIndex[to][tokenId] = myLands[to].length;

			myLandStatuses[to].push(status[tokenId]);
			ownerLandStatusIndex[to][tokenId] = myLandStatuses[to].length;

			if (status[tokenId] > 1) {
				eqCount[to][status[tokenId]]++;
				latestInstall[to][status[tokenId]] = block.timestamp;
			}
		}
	}

	function updateStatus(uint tokenId, uint newStatus) payable external {
		require(newStatus >= 2);
		require(newStatus <= 10);
		require(msg.value == prices[newStatus]);
		require(ownerOf(tokenId) == msg.sender);
		require(status[tokenId] != newStatus);

		// land rating 1
		if (tokenId > 516027 && newStatus != 2 && newStatus != 5 && newStatus != 8) revert('Incompatible Miner');

		// land rating 2
		else if (tokenId > 207974 && tokenId <= 516027 && (newStatus == 4 || newStatus == 7 || newStatus == 10)) revert('Incompatible Miner');

		myLandStatuses[msg.sender][ownerLandStatusIndex[msg.sender][tokenId] - 1] = newStatus;

		latestInstall[msg.sender][newStatus] = block.timestamp;

		if (status[tokenId] > 1) eqCount[msg.sender][status[tokenId]]--;
		eqCount[msg.sender][newStatus]++;

		status[tokenId] = newStatus;
	}

	function updateMultiple(uint[] memory tokenIds, uint newStatus) payable external {
		uint count = tokenIds.length;
		require(count > 0, "No Selection");

		require(newStatus >= 2);
		require(newStatus <= 10);

		require(msg.value == prices[newStatus] * count, "Invalid Amount");

		uint level = getLevel(tokenIds[0]);

		// land rating 1
		if (level == 0 && newStatus != 2 && newStatus != 5 && newStatus != 8) revert('Incompatible Miner');

		// land rating 2
		else if (level == 1 && (newStatus == 4 || newStatus == 7 || newStatus == 10)) revert('Incompatible Miner');

		for (uint i = 0; i < tokenIds.length; i++) {
			require(ownerOf(tokenIds[i]) == msg.sender);
			require(tokenIds[i] > 0, "Invalid Token Id");
			require(tokenIds[i] <= lastToken, "Invalid Token Id");
			require(level == getLevel(tokenIds[i]));

			myLandStatuses[msg.sender][ownerLandStatusIndex[msg.sender][tokenIds[i]] - 1] = newStatus;

			latestInstall[msg.sender][newStatus] = block.timestamp;

			if (status[tokenIds[i]] > 1) eqCount[msg.sender][status[tokenIds[i]]]--;
			eqCount[msg.sender][newStatus]++;

			status[tokenIds[i]] = newStatus;
		}
	}

	function getStatus(uint start, uint end) public view returns (uint[] memory) {
		require(end >= start);
		require(end <= lastToken);

		uint[] memory arr = new uint[](end - start + 1);
		uint counter = 0;
		for (uint i = start; i <= end; i++) {
			arr[counter] = status[i];
			counter++;
		}

		return arr;
	}

	uint[] private featured;
	function addFeat(uint tokenId) public {
		require(msg.sender == admin, "Access Denied");
		featured.push(tokenId);
	}
	function addFeatMultiple(uint[] memory tokenIds) public {
		require(msg.sender == admin, "Access Denied");
		for (uint i = 0; i < tokenIds.length; i++) {
			featured.push(tokenIds[i]);
		}
	}
	function getFeatured() public view returns (uint[] memory) {
		uint[] memory arr = new uint[](featured.length);
		for (uint i = 0; i < featured.length; i++) {
			arr[i] = status[featured[i]];
		}

		return arr;
	}

	uint private offerFund;
	struct Offer {
		uint id;

		address from;
		uint fromIndex;

		address to;
		uint toIndex;

		uint tokenId;
		uint amt;
	}
	Offer[] private offers;
	mapping(address => Offer[]) private offersMade;
	mapping(address => Offer[]) private offersRcvd;
	function makeOffer(uint tokenId) external payable {
		require(msg.value > 0, "Invalid Value");
		require(msg.sender != ownerOf(tokenId));

		Offer memory offer = Offer(
			offers.length + 1,
			msg.sender,
			offersMade[msg.sender].length + 1,
			ownerOf(tokenId),
			offersRcvd[ownerOf(tokenId)].length + 1,
			tokenId,
			msg.value
		);

		offers.push(offer);
		offersMade[msg.sender].push(offer);
		offersRcvd[ownerOf(tokenId)].push(offer);

		offerFund += msg.value;
	}

	function cancelOffer(uint offerId) public {
		Offer memory offer = offers[offerId - 1];
		require(offer.from == msg.sender);

		payable(offer.from).transfer(offer.amt);
		offerFund -= offer.amt;

		delete offers[offerId - 1];
		delete offersMade[msg.sender][offer.fromIndex - 1];
		delete offersRcvd[offer.to][offer.toIndex - 1];
	}

	function acceptOffer(uint offerId) public {
		Offer memory offer = offers[offerId - 1];
		require(offer.to == msg.sender);

		safeTransferFrom(msg.sender, offer.from, offer.tokenId);
		payable(offer.to).transfer(offer.amt);
		offerFund -= offer.amt;

		delete offers[offerId - 1];
		delete offersMade[offer.from][offer.fromIndex - 1];
		delete offersRcvd[msg.sender][offer.toIndex - 1];
	}

	function getOffers(address addr, uint oType) public view returns (Offer[] memory) {
		if (oType == 0) return offersMade[addr];
		else return offersRcvd[addr];
	}


	function withdraw() public {
		require(msg.sender == admin, "Access Denied");
		payable(admin).transfer(address(this).balance - offerFund);
	}
}
